import React from 'react'
import { connect } from 'react-redux'

function Main(props) {
    console.log(props, 'props');
    return (
        <Switch>
        <Route exact path={`${match.url}/home`} component={() => <div>Home Content</div>} />
        <Route path={`${match.url}/about`} component={() => <div>About Content</div>} />
        <Route path={`${match.url}/services`} component={() => <div>Services Content</div>} />
      </Switch>
    )
}

export default connect(
    state => ({
        routerMenu: state.routerMenu
    })
)(Main);
